import React, { Component } from 'react'


export default class App extends Component {
  constructor(props){
    super(props)
    this.state={
        first_flag: false,
        second_flag: false,
        uncheck_flag: false,
    }
  }
  first = ()=>{
    this.setState({
      first_flag: true,
    })
  }
  second = ()=>{
    this.setState({
      first_flag: true,
    })
  }
  uncheck = ()=>{
    this.setState({
      first_flag: false,
      second_flag: false,
      uncheck_flag: true,
    })
  }
  render() {
    return (
      <div>
        <input type="checkbox" onChange={this.first}></input>
        <input type="checkbox" onChange={this.second}></input>
        <input type="checkbox" onChange={this.uncheck}></input>
      </div>
    )
  }
}
